import Vue from "vue";
import App from "./App.vue";
import router from "./router";
import "./plugins/element.js";
import "./plugins/global.css";
import store from "./store/store.js";

import axios from "axios";
Vue.prototype.$http = axios;
// 配置请求的根目录
// 本地mock测试环境
// Vue.prototype.$http.defaults.baseURL = 'http://127.0.0.1:4523/m1/1426632-0-default'
// 本地测试环境
Vue.prototype.$http.defaults.baseURL = "http://localhost:8081/api/v1";
// 服务器
// Vue.prototype.$http.defaults.baseURL = "http://122.9.215.185:8081/api/v1";

Date.prototype.format = function (fmt) {
  var o = {
    "M+": this.getMonth() + 1, //月份
    "d+": this.getDate(), //日
    "h+": this.getHours(), //小时
    "m+": this.getMinutes(), //分
    "s+": this.getSeconds(), //秒
  };
  if (/(y+)/.test(fmt)) {
    fmt = fmt.replace(
      RegExp.$1,
      (this.getFullYear() + "").substr(4 - RegExp.$1.length)
    );
  }
  for (var k in o) {
    if (new RegExp("(" + k + ")").test(fmt)) {
      fmt = fmt.replace(
        RegExp.$1,
        RegExp.$1.length == 1 ? o[k] : ("00" + o[k]).substr(("" + o[k]).length)
      );
    }
  }
  return fmt;
};

Vue.config.productionTip = false;

new Vue({
  router,
  store,
  render: (h) => h(App),
}).$mount("#app");
